    data: |
      SELECT ALL col0 + - 50 AS col2 FROM tab0 (FORMAT parquet) WHERE + + col0 NOT IN ( - col0 + - - 51 / - + col2 + + + col1 );
  - name: tab0

outputs:
  - name: q5826.out
    data: |
      -35
      37
      47
